function I = fcnK4S(S, T, u, alpha, F, tol)
t1 = 0.1e1 ./ T;t2 = t1 .* u;t3 = sqrt(-u);t4 = 0.1e1 ./ t3;t5 = t4 .* t2;t6 = T .^ 2;t9 = 0.1e1 ./ (-t6 + 0.4e1 .* u);t10 = F - t3;t11 = t10 .^ 2;t12 = 0.2e1 .* t3;t14 = t10 .* (T + t12);t15 = t3 .* T;t17 = sqrt(t11 + t14 + t15);t18 = 0.1e1 ./ t17;t19 = t18 .* t9;t20 = F .* t19;t23 = t4 .* u;t26 = 0.1e1 ./ t6 .* u;t35 = F .^ 2;t38 = sqrt(F .* T + t35 + u);t44 = F + t3;t45 = t44 .^ 2;t47 = t44 .* (T - t12);t49 = sqrt(t45 + t47 - t15);t50 = 0.1e1 ./ t49;t53 = t50 .* t9;t60 = F .* t53;t63 = 0.2e1 .* t20 .* t5 + t19 .* t23 + 0.3e1 ./ 0.4e1 .* t18 .* t4 .* t26 - 0.3e1 ./ 0.2e1 .* t19 .* t2 + 0.2e1 ./ t38 .* t9 .* (0.2e1 .* F + T) + 0.3e1 ./ 0.8e1 .* t18 .* t1 + 0.3e1 ./ 0.8e1 .* t50 .* t1 - t53 .* t23 - 0.3e1 ./ 0.4e1 .* t50 .* t4 .* t26 - 0.3e1 ./ 0.2e1 .* t53 .* t2 - 0.2e1 .* t60 .* t5;t64 = t9 .* T;t68 = sqrt(t15);t69 = 0.1e1 ./ t68;t71 = 0.2e1 .* t15;t75 = 0.1e1 ./ t10;t77 = log(t75 .* (0.2e1 .* t17 .* t68 + t14 + t71));t83 = sqrt(-t15);t84 = 0.1e1 ./ t83;t89 = 0.1e1 ./ t44;t91 = log(t89 .* (0.2e1 .* t49 .* t83 + t47 - t71));t114 = -0.3e1 ./ 0.8e1 .* t18 .* t64 - 0.3e1 ./ 0.4e1 .* t20 - 0.3e1 ./ 0.8e1 .* t77 .* t69 .* t1 - 0.3e1 ./ 0.8e1 .* t50 .* t64 - 0.3e1 ./ 0.4e1 .* t60 - 0.3e1 ./ 0.8e1 .* t91 .* t84 .* t1 + t18 .* t75 .* t4 .* t2 ./ 0.4e1 - 0.3e1 .* t20 .* t26 - 0.3e1 ./ 0.4e1 .* t77 .* t69 .* t4 .* t26 - t50 .* t89 .* t4 .* t2 ./ 0.4e1 - 0.3e1 .* t60 .* t26 + 0.3e1 ./ 0.4e1 .* t91 .* t84 .* t4 .* t26;t115 = t63 + t114;
I = t115(:,:,2) - t115(:,:,1);

end
